JoyMii - Pure Kiara
Added: March 05, 2015

Kiara is alone in her room. Perhaps she just finished doing some hot cam sessions. Perhaps she's just bored at home, trying to avoid her homework. Whatever it is, she notices a toy on the couch. All it needs are batteries, and maybe it will do something magical. The curious type, Kiara decides to insert the batteries, and then insert the toy. And o boy does it do something magical. Kiara is definitely the explorative type, and you get to watch her explore every secret she has, going from one extreme bliss to another. Thank you, sweet Kiara!
